import React from 'react';
import { Link } from 'react-router-dom';
const Navbar = () => {
  return <nav>
    <ul>
      <li>
        <Link to="/">Home</Link>
      </li>

        <li>
        <Link to="/">About</Link>
      </li>

        <li>
        <Link to="/">Home</Link>
      </li>

    </ul>
  </nav>;
};

export default Navbar;
